import React from "react";
import "./news.css";

const news = props => {
  return (
    <div>
        <div>
            <img src={props.image} alt=""/>
        </div>
        <div>
            {props.title}
            {props.source}
            {props.publishtime}
            {props.link}
        </div>
    </div>
  );
};

export default news;
